B.aaz=new A.nN("afirmace_ranni","Rann\xed","Rann\xed Afirmace","assets/audio/afirmace_ranni.mp3","assets/images/tile_afirmace.png","Nastartuj sv\u016fj den, pomoc\xed t\xe9to afirmace, kter\xe1 ti pom\u016f\u017ee udr\u017eet cel\xfd den pozornost na tom, co je d\u016fle\u017eit\xe9. Tvoje p\u0159\xe1n\xed se budou plnit lusknut\xedm prstu.","assets/audio/afirmace.png")
B.aaA=new A.nN("meditace_prani","P\u0159\xe1n\xed","Meditace pro p\u0159\xe1n\xed","assets/audio/meditace_prani.mp3","assets/images/tile_meditace.png","Tato vizualizace s prvky meditace pom\xe1h\xe1 k nastaven\xed mysli na z\xedsk\xe1n\xed toho, co v \u017eivot\u011b chceme. Imaginace s relakcac\xed a uvoln\u011bn\xedm m\xe1 jedny z nejv\u011bt\u0161\xedch a nejv\xfdznamn\u011bj\u0161\xedch \xfa\u010dink\u016f a vliv\u016f na to, co si p\u0159ejeme i na manifestaci.","assets/audio/meditace.png")
B.aaB=new A.nN("meditace_podvedomi","Podv\u011bdom\xed","Meditace pro podv\u011bdom\xed","assets/audio/meditace_podvedomi.mp3","assets/images/tile_meditace.png","Komunikace s podv\u011bdom\xedm nen\xed nemo\u017en\xe1. Nau\u010dte se komunikovat s podv\u011bdom\xedm a dosta\u0148te odpov\u011bdi a \u0159e\u0161en\xed na v\u0161echny va\u0161e ot\xe1zky a probl\xe9my. Tato velmi \xfa\u010dinn\xe1 meditace a sugesce v\xe1m pom\u016f\u017ee.","assets/audio/meditace.png")
B.aaC=new A.nN("afirmace_zdravi","Pro zdrav\xed","Afirmace pro zdrav\xed","assets/audio/afirmace_zdravi.mp3","assets/images/tile_afirmace.png","Tato afirmace pro zdrav\xed je sestavena tak, aby zapo\u010dala proces l\xe9\u010den\xed a uzdraven\xed. Obsahuje pr\xe1ci s mysl\xed, s pot\u0159ebou vytv\xe1\u0159et a dr\u017eet si nemoc, a jde tak hloub\u011bji k probl\xe9mu, nikoli jen po jeho povrchu","assets/audio/afirmace.png")
